INSERT INTO `mkb` (`id`, `icd`, `name`) VALUES
(1, 'A00', 'ХОЛЕРА'),
(2, 'A01', 'БРЮШНОЙ ТИФ И ПАРАТИФ'),
(3, 'A02', 'ДРУГИЕ САЛЬМОНЕЛЛЕЗНЫЕ ИНФЕКЦИИ'),
(4, 'A03', 'ШИГЕЛЛЕЗ'),
(5, 'A04', 'ДРУГИЕ БАКТЕРИАЛЬНЫЕ КИШЕЧНЫЕ ИНФЕКЦИИ'),
(6, 'A05', 'ДРУГИЕ БАКТЕРИАЛЬНЫЕ ПИЩЕВЫЕ ОТРАВЛЕНИЯ'),
(7, 'A06', 'АМЕБИАЗ'),
(8, 'A07', 'ДРУГИЕ ПРОТОЗОЙНЫЕ КИШЕЧНЫЕ БОЛЕЗНИ'),
(9, 'A08', 'ВИРУСНЫЕ И ДРУГИЕ УТОЧНЕННЫЕ КИШЕЧНЫЕ ИНФЕКЦИИ'),
(10, 'A09', 'ДИАРЕЯ И ГАСТРОЭНТЕРИТ ПРЕДПОЛОЖИТЕЛЬНО ИНФЕКЦИОННОГО ПРОИСХОЖДЕНИЯ'),
(11, 'A15.0', 'ТУБЕРКУЛЕЗ ЛЕГКИХ, ПОДТВЕРЖДЕННЫЙ БАКТЕРИОЛОГИЧЕСКИ С НАЛИЧИЕМ ИЛИ ОТСУТСТВИЕМ РОСТА КУЛЬТУРЫ'),
(12, 'A15.1', 'ТУБЕРКУЛЕЗ ЛЕГКИХ, ПОДТВЕРЖДЕННЫЙ ТОЛЬКО РОСТОМ КУЛЬТУРЫ'),
(13, 'A15.2', 'ТУБЕРКУЛЕЗ ЛЕГКИХ, ПОДТВЕРЖДЕННЫЙ ГИСТОЛОГИЧЕСКИ'),
(14, 'A15.3', 'ТУБЕРКУЛЕЗ ЛЕГКИХ, ПОДТВЕРЖДЕННЫЙ НЕУТОЧНЕННЫМИ МЕТОДАМИ'),
(15, 'A15.4', 'ТУБЕРКУЛЕЗ ВНУТРИГРУДНЫХ ЛИМФАТИЧЕСКИХ УЗЛОВ, ПОДТВЕРЖДЕННЫЙ БАКТЕРИОЛОГИЧЕСКИ И ГИСТОЛОГИЧЕСКИ'),
(16, 'A15.5', 'ТУБЕРКУЛЕЗ ГОРТАНИ, ТРАХЕИ И БРОНХОВ, ПОДТВЕРЖД.БАКТЕРИОЛОГИЧЕСКИ И ГИСТОЛОГИЧЕСКИ'),
(17, 'A15.6', 'ТУБЕРКУЛЕЗНЫЙ ПЛЕВРИТ, ПОДТВЕРЖДЕННЫЙ БАКТЕРИОЛОГИЧЕСКИ И ГИСТОЛОГИЧЕСКИ'),
(18, 'A15.7', 'ПЕРВИЧНЫЙ ТУБЕРКУЛЕЗ ОРГАНОВ ДЫХАНИЯ, ПОДТВЕРЖД.БАКТЕРИОЛОГИЧЕСКИ И ГИСТОЛОГИЧЕСКИ'),
(19, 'A15.8', 'ТУБЕРКУЛЕЗ ДРУГИХ ОРГАНОВ ДЫХАНИЯ, ПОДТВЕРЖДЕННЫЙ БАКТЕРИОЛОГИЧЕСКИ И ГИСТОЛОГИЧЕСКИ'),
(20, 'A15.9', 'ТУБЕРКУЛЕЗ НЕУТОЧНЕННЫХ ОРГАНОВ ДЫХАНИЯ, ПОДТВЕРЖДЕННЫЙ БАКТЕРИОЛОГИЧЕСКИ И ГИСТОЛОГИЧЕСКИ'),
(21, 'A16.0', 'ТУБЕРКУЛЕЗ ЛЕГКИХ ПРИ ОТРИЦАТЕЛЬНЫХ РЕЗУЛЬТАТАХ БАКТЕРИОЛОГИЧЕСКИХ И ГИСТОЛОГИЧЕСКИХ ИССЛЕДОВАНИЙ'),
(22, 'A16.1', 'ТУБЕРКУЛЕЗ ЛЕГКИХ БЕЗ ПРОВЕДЕНИЯ БАКТЕРИОЛОГИЧЕСКОГО И ГИСТОЛОГИЧЕСКОГО ИССЛЕДОВАНИЙ'),
(23, 'A16.2', 'ТУБЕРКУЛЕЗ ЛЕГКИХ БЕЗ УПОМИНАНИЯ О БАКТЕРИОЛОГИЧЕСКОМ ИЛИ ГИСТОЛОГИЧЕСКОМ ПОДТВЕРЖДЕНИИ'),
(24, 'A16.3', 'ТУБЕРКУЛЕЗ ВНУТРИГРУДНЫХ ЛИМФАТИЧЕСКИХ УЗЛОВ БЕЗ УПОМИНАНИЯ О БАКТЕРИОЛОГИЧЕСКОМ ИЛИ ГИСТОЛОГИЧЕСКОМ ПОДТВЕРЖДЕНИИ'),
(25, 'A16.4', 'ТУБЕРКУЛЕЗ ГОРТАНИ, ТРАХЕИ И БРОНХОВ БЕЗ УПОМИНАНИЯ О БАКТЕРИОЛОГИЧЕСКОМ ИЛИ ГИСТОЛОГИЧЕСКОМ ПОДТВЕРЖДЕНИИ'),
(26, 'A16.5', 'ТУБЕРКУЛЕЗНЫЙ ПЛЕВРИТ БЕЗ УПОМИНАНИЯ О БАКТЕРИОЛОГИЧЕСКОМ ИЛИ ГИСТОЛОГИЧЕСКОМ ПОДТВЕРЖДЕНИИ'),
